import React from "react";
import imagenes from "./assets/imagenes";
import "./prueba.css";

const images = [
  ["img11", "img12"],
    ["img21", "img22"],
    ["img31", "img32"],
    ["img51", "img52"],
    ["img53", "img54"]
];

const Collage = () => {
  return (
    <div className="collage">
      {images.map((img, index) => (
        <div className="collage-item" key={index} style={{ backgroundImage: `url(${img})` }}></div>
      ))}
    </div>
  );
};

export default Collage;
